            <CategoryCard title={"Title"} />
          </div>
        </div>
        <div className="flex flex-col gap-10 border-2 border-white rounded-lg p-4 bg-white">
          <Heading
            title={"Featured Products"}
            heading={"Our Featured Products"}
          />
          <div className="grid grid-cols-5 gap-4">
          {list.map(e=>{
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
          })}

          </div>
        </div>
      </div>
    </section>
  );
};

export default Homepage;
